  false,\n\t\"url\": null,\n\t\"notes\": \"This data set comprises the Environmental
  Sensitivity Index (ESI) maps for the Aleutian Islands, Alaska. ESI data characterize
  coastal environments and wildlife by their sensitivity to spilled oil. The ESI data
  include information for three main components: shoreline habitats; sensitive biological
  resources; and human-use resources. This atlas was developed to be utilized within
  desktop GIS systems and contains GIS files and related data files. Associated files
  include MOSS (Multiple Overlay Statistical System) export files, .PDF maps, and
  detailed user guides and metadata.nnGeographic features data such as fault lines,
  geothermal activity, and volcanoes data from the 1950s. Biological and shoreline
  data utilized in this atlas data from the late 1970s to 2001. Data sources are documented
  within the included metadata. Data were compiled during 2000-2001.nnDO NOT USE ESI
  MAPS FOR NAVIGATIONAL PURPOSES.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
